// @skip-codegen-identical-test

syntax = "proto2";

import "rustproto.proto";
option (rustproto.generate_accessors_all) = true;


package test_lite_runtime;

option optimize_for = LITE_RUNTIME;

enum EnumTestLiteRuntime {
    UNKNOWN = 0;
    ONE = 1;
    TWO = 2;
}

message TestLiteRuntime {
    optional int32 v = 1;
}
